import React from 'react';
import '../main.css';

function AuthorPile() {
  var picPath = require('./img/people/kjfeng.jpeg')
  return (
    <div className="authorpile">

      <div className="circle-pic" style={{backgroundImage: `url(${picPath})`}}></div>
      <h5 className="author-name">Kevin Feng</h5>

    </div>
  );
}

export default AuthorPile;
